import { Navba } from "react-bootstrap";
import { NavLink} from "react-router-dom";
import { Link } from "react-router-dom";
import img from "../assets/img/localizacion.jpg";

export default function Navigation() {
  return (
    <>
      <NavLink className="color-menu d-flex justify-content-between align-items-center ">
        <Link to="#" className="text-white me-4 text-decoration-none">
          <img src={img} alt="" />
        </Link>
        <div>
          <Link to="/" className="text-white ms-4 text-decoration-none ">
            Home
          </Link>
          <Link
            to="/Pokemones"
            className=" text-white ms-4 text-decoration-none "
          >
            Pokemones
          </Link>
        </div>
      </NavLink>
    </>
  );
}
